
SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS `fort_siege_guards`;
CREATE TABLE `fort_siege_guards` (
  `fortId` int(11) NOT NULL DEFAULT '0',
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `npcId` int(11) NOT NULL DEFAULT '0',
  `x` int(11) NOT NULL DEFAULT '0',
  `y` int(11) NOT NULL DEFAULT '0',
  `z` int(11) NOT NULL DEFAULT '0',
  `heading` int(11) NOT NULL DEFAULT '0',
  `respawnDelay` int(11) NOT NULL DEFAULT '0',
  `isHired` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `id` (`fortId`)
) ENGINE=InnoDB AUTO_INCREMENT=3408 DEFAULT CHARSET=utf8;

